import React from 'react';
import { Routes, Route } from 'react-router-dom';
import FirstScreen from './screens/FirstScreen';

function App() {
  return (
    <Routes>
      <Route path="/">
        <FirstScreen />
      </Route>
      <Route path="/focus">
        <div>Focus</div>
      </Route>
    </Routes>
  );
}

export default App;
